int main()
{
    long long int t,s,x;
    scanf("%lld %lld %lld",&t,&s,&x);
    if(x==t)
    {
        printf("YES\n");
    }
    else if(((x-t)/s)>=1&&((x-t)%s==0||(x-t)%s==1))
    {
        printf("YES\n");
    }
    else
    {
        printf("NO\n");
    }
}
