['#include<stdio.h>
int main()
{
    int t,s,x;
    scanf("%d %d %d",&t,&s,&x);
    if((x >= t && x % s == t % s)||(x > t + 1 && x % s == (t + 1) % s)){
        printf("YES\n");
    }
    else printf("NO\n");
    return 0;
}
']

